package org.example.custom;import java.util.*;public class MyStructure {    List<Integer> arr = new ArrayList<>();    Map<Integer, Integer> map = new HashMap<>();    public boolean insert(int x) {        if(!map.containsKey(x)) {            int index = arr.size();            arr.add(x);            map.put(x, index);            return true;        }        return  false;    }    public boolean delete(int x) {        if(map.containsKey(x)) {            int index = map.get(x);            map.remove(x);            if (index != arr.size() - 1) {                int last = arr.size() - 1;                Collections.swap(arr, index, last);                if(last != index) {                    map.put(arr.get(index), index);                }            }            arr.removeLast();                    }        return false;    }    public int search(int x) {        return map.getOrDefault(x, -1);    }    public int getRandom() {        Random random = new Random();        return arr.get(random.nextInt(arr.size()-1));    }    public static void main(String[] args) {        MyStructure structure = new MyStructure();        structure.insert(10);        structure.insert(20);        structure.delete(10);        structure.insert(22);        System.out.println(structure.getRandom());        System.out.println(structure.search(10));    }}